style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 5px; padding: 0px; position: relative; float: left; width: 616px;\"><span class=\"wprm-recipe-ingredient-amount-wrap\" style=\"box-sizing: border-box; width: 150px; display: inline-block; float: left; min-height: 20px;\"><span class=\"wprm-recipe-ingredient-amount\" style=\"box-sizing: border-box;\">1/2</span>&nbsp;<span class=\"wprm-recipe-ingredient-unit\" style=\"box-sizing: border-box;\">teaspoon</span></span>\r\n	<div class=\"wprm-recipe-ingregient-name-wrap\" style=\"box-sizing: border-box; float: left; width: 308px;\"><span class=\"wprm-recipe-ingredient-name\" style=\"box-sizing: border-box;\">saffron threads</span></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-ingredient\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 5px; padding: 0px; position: relative; float: left; width: 616px;\">\r\n	<div class=\"wprm-recipe-ingregient-name-wrap\" style=\"box-sizing: border-box; float: left; width: 308px;\"><span class=\"wprm-recipe-ingredient-name\" style=\"box-sizing: border-box;\">cilantro</span>&nbsp;<span class=\"wprm-recipe-ingredient-notes\" style=\"box-sizing: border-box; font-style: italic; font-size: 0.8em; margin-left: 3px;\">(for garnish)</span></div>\r\n	</li>\r\n</ul>\r\n</div>\r\n', '<ol class=\"wprm-recipe-instructions\" style=\"box-sizing: border-box; margin: 0px; padding-right: 0px; padding-left: 0px; margin-block-start: 0px; margin-block-end: 0px; padding-inline-start: 0px; list-style: none; counter-reset: item 0; font-family: Montserrat, sans-serif; font-size: 16px; text-align: left;\">\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">To marinate the chicken for the biryani, combine the vegetable oil, garlic, ginger, chili peppers, mint, cilantro, garam masala, cinnamon and salt in a large bowl and stir together. Add the chicken pieces and toss together making sure the chicken is thoroughly coated in the marinade. Allow the chicken to marinate for at least 1 hour or up to overnight.</div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">In a pot wide enough to hold the chicken in a single layer, add the ghee and onions and saute the onions until they are well caramelized (15-20 minutes). Transfer the caramelized onions to a bowl and set aside.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"Caramelized onions add a pleasant sweetness to contrast the spicy chicken in the Biryani.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-3-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">While the onions caramelize, prepare the rice by washing in a strainer under cold running water until the water runs clear.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"It\'s important to wash your rice thouroughly to rid it of any excess starch so your Biryani turns out fluffy.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-1-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">To par-boil the rice, add the water, salt, cardamom, cumin and bay leaf to a pot and bring to a boil. Add the rice and boil for 7 minutes. Drain the rice, reserving 1 cup of the liquid.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"Parboiling the rice with spices not only ensures the rice is cooked through, it infuses your biryani with tons of flavor.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-2-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">In the pot you caramelized the onions in, add the chicken in a single layer, skin-side down. Fry until golden brown on one side (about 5 minutes). Flip the chicken over and fry the other side until golden brown. Transfer the chicken back to the bowl you marinated it in.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"Browning the chicken for the Biryani brings out the flavors of the spices and aromatics in the marinade.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-4-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">To assemble the biryani, add the saffron to the rice and toss to distribute evenly. Add half the rice mixture to the bottom of the pot you browned the chicken in.</div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">Top the rice with the chicken in a single layer.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"The browned chicken gets layeed on the rice.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-6-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">Top the chicken with an even layer of caramelized onions.</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"A layer of caramelized onions goes on top of the chicken for the Biryani.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-7-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">\r\n	<p data-birdsend-par-index=\"8\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 1em;\">Finish putting together the Biryani by adding the rest of the rice in an even layer. Add 1 cup of reserved liquid from boiling the rice. Cover the pot with a lid and put the pot on the stove over medium heat and set the timer for 20 minutes. When you can see steam escaping from under the lid, turn down the heat to low and continue cooking until the timer goes off and then turn off the heat.</p>\r\n	</div>\r\n\r\n	<div class=\"wprm-recipe-instruction-image\" style=\"box-sizing: border-box; margin: 20px -20px 0px -50px;\"><img alt=\"The Biryani is finished off with a layer of saffron rice.\" class=\"attachment-700x400 size-700x400\" height=\"394\" sizes=\"(max-width: 700px) 100vw, 700px\" src=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8.jpg\" srcset=\"https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_2000/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8.jpg 2000w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_900/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-900x506.jpg 900w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1200/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-1200x675.jpg 1200w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_250/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-250x141.jpg 250w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_480/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-480x270.jpg 480w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_768/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-768x432.jpg 768w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_645/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-645x363.jpg 645w, https://cdn.shortpixel.ai/client/q_lossy,ret_img,w_1290/https://norecipes.com/wp-content/uploads/2017/05/chicken-biryani-8-1290x726.jpg 1290w\" style=\"box-sizing: border-box; border: 0px; height: auto; max-width: 100%; width: 656px;\" width=\"700\" /></div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px 0px 20px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">\r\n	<p data-birdsend-par-index=\"9\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 1em;\">Without opening the lid, set the timer for another 10 minutes to steam the biryani.</p>\r\n	</div>\r\n	</li>\r\n	<li class=\"wprm-recipe-instruction\" style=\"box-sizing: border-box; list-style: none; font-size: 1em; margin: 0px; padding: 0px 20px 0px 50px; position: relative; counter-increment: item 1;\">\r\n	<div class=\"wprm-recipe-instruction-text\" style=\"box-sizing: border-box;\">Mix the Chicken Biryani together and then transfer to a serving platter. Garnish with fresh cilantro and serve.</div>\r\n	</li>\r\n</ol>', 150, 'Lunch,Dinner', 0, 1, 305, 'en', 1, 0, 1, 1, '2020-03-31 06:53:59', NULL, NULL),
